import { ImageResponse } from 'next/og'

export function generateImageMetadata() {

  const sizes = [
    2048,
    1668,
    1536,
    1125,
    1242,
    750,
    640,
    ];

  const sizes_data = sizes.map((v) => {
    const data = {
      contentType: "image/png",
      size: { width: v, height: v },
      id: v,
    };

    return data;
  });

  return sizes_data;
}

